import React, { useState, useEffect } from "react";
import { useLocation, useNavigate } from "react-router-dom";
import axios from "axios";
import Navbar from "../homepage/Navbar";

const API_URL = "http://127.0.0.1:8000/api/resale/raw_Data";

const SearchResults = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const searchParams = new URLSearchParams(location.search);

  const initialDistrict = searchParams.get("district") || "";
  const initialStartYear = searchParams.get("startYear") || "";
  const initialEndYear = searchParams.get("endYear") || "";

  const [district, setDistrict] = useState(initialDistrict);
  const [startYear, setStartYear] = useState(initialStartYear);
  const [endYear, setEndYear] = useState(initialEndYear);
  const [sortOrder, setSortOrder] = useState("asc");
  const [filteredResults, setFilteredResults] = useState([]);
  const [selectedListing, setSelectedListing] = useState(null);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    if (district && startYear && endYear) {
      fetchData();
    }
  }, []);

  const fetchData = () => {
    setLoading(true);
    const params = new URLSearchParams();
    params.append("town", district);
    params.append("start_year", startYear);
    params.append("end_year", endYear);

    axios
      .get(`${API_URL}?${params.toString()}`)
      .then((res) => {
        let results = res.data;

        // Sort by price
        results.sort((a, b) =>
          sortOrder === "asc" ? a.resale_price - b.resale_price : b.resale_price - a.resale_price
        );

        setFilteredResults(results);
      })
      .catch((err) => {
        console.error("‚ùå Error fetching data:", err);
        setFilteredResults([]);
      })
      .finally(() => setLoading(false));
  };

  const handleFilter = () => {
    fetchData();
  };

  const handleKeyPress = (e) => {
    if (e.key === "Enter") fetchData();
  };

  return (
    <div className="min-h-screen bg-gray-100 text-red-900">
      <Navbar />
      <div className="max-w-5xl mx-auto mt-10 px-6">
        <h1 className="text-4xl font-bold text-center mb-10">üè† HDB Past Listings</h1>

        {/* Filters */}
        <div className="bg-white p-6 shadow-md rounded-lg mb-10">
          <h2 className="text-xl font-semibold mb-3">üîé Filter Listings</h2>
          <div className="flex flex-wrap gap-4 items-center">
            <input type="text" value={district} onChange={(e) => setDistrict(e.target.value)} placeholder="Search by District" className="border px-4 py-2 rounded-lg w-64" onKeyPress={handleKeyPress} />
            <input type="number" value={startYear} onChange={(e) => setStartYear(e.target.value)} placeholder="Start Year" className="border px-4 py-2 rounded-lg w-32" onKeyPress={handleKeyPress} />
            <input type="number" value={endYear} onChange={(e) => setEndYear(e.target.value)} placeholder="End Year" className="border px-4 py-2 rounded-lg w-32" onKeyPress={handleKeyPress} />
            <select value={sortOrder} onChange={(e) => setSortOrder(e.target.value)} className="border px-4 py-2 rounded-lg">
              <option value="asc">Sort by Price: Low to High</option>
              <option value="desc">Sort by Price: High to Low</option>
            </select>
            <button onClick={handleFilter} className="px-6 py-2 bg-red-600 text-white font-bold rounded-lg shadow-lg hover:bg-red-700 transition-all">
              ‚úÖ Apply Filter
            </button>
          </div>
        </div>

        {/* Listings Table */}
        {loading ? (
          <p className="text-center text-blue-500 font-semibold">Loading...</p>
        ) : filteredResults.length > 0 ? (
          <div className="bg-white p-6 shadow-md rounded-lg">
            <h2 className="text-xl font-semibold mb-4">üìã Search Results</h2>
            <table className="w-full border-collapse border border-gray-300">
              <thead>
                <tr className="bg-red-600 text-white">
                  <th className="border px-6 py-3">District</th>
                  <th className="border px-6 py-3">Year</th>
                  <th className="border px-6 py-3">Month</th>
                  <th className="border px-6 py-3">Flat Type</th>
                  <th className="border px-6 py-3">Price</th>
                </tr>
              </thead>
              <tbody>
                {filteredResults.map((item, index) => (
                  <tr
                    key={index}
                    className="border bg-gray-50 hover:bg-gray-200 transition cursor-pointer"
                    onClick={() => setSelectedListing(item)}
                  >
                    <td className="border px-6 py-3 text-center">{item.town}</td>
                    <td className="border px-6 py-3 text-center">{item.year}</td>
                    <td className="border px-6 py-3 text-center">{new Date(item.month).toLocaleString("default", { month: "long" })}</td>
                    <td className="border px-6 py-3 text-center">{item.flat_type}</td>
                    <td className="border px-6 py-3 text-center">${Number(item.resale_price).toLocaleString()}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        ) : (
          <div className="bg-white p-6 shadow-md rounded-lg text-center text-red-600 font-semibold">
            ‚ùå No records found for this search.
          </div>
        )}

        {/* Back */}
        <div className="text-center mt-6">
          <button
            onClick={() => navigate("/")}
            className="px-6 py-3 bg-red-600 text-white font-bold rounded-lg shadow-lg hover:bg-red-700 transition-all"
          >
            ‚¨Ö Back to Homepage
          </button>
        </div>
      </div>

      {/* Modal */}
      {selectedListing && (
        <div className="fixed inset-0 bg-black bg-opacity-50 flex justify-center items-center" onClick={() => setSelectedListing(null)}>
          <div className="bg-white p-6 rounded-lg shadow-lg w-96" onClick={(e) => e.stopPropagation()}>
            <h2 className="text-2xl font-bold mb-4">üè† Listing Details</h2>
            <p><strong>District:</strong> {selectedListing.town}</p>
            <p><strong>Year:</strong> {selectedListing.year}</p>
            <p><strong>Month:</strong> {new Date(selectedListing.month).toLocaleString("default", { month: "long" })}</p>
            <p><strong>Flat Type:</strong> {selectedListing.flat_type}</p>
            <p><strong>Price:</strong> ${Number(selectedListing.resale_price).toLocaleString()}</p>
            {selectedListing.floor_area_sqm && (
              <p><strong>Floor Area:</strong> {selectedListing.floor_area_sqm} sqm</p>
            )}
            {selectedListing.lease_commence_date && (
              <p><strong>Lease Commence:</strong> {selectedListing.lease_commence_date}</p>
            )}

            <button onClick={() => setSelectedListing(null)} className="mt-4 px-4 py-2 bg-red-600 text-white font-bold rounded-lg hover:bg-red-700 transition">
              ‚ùå Close
            </button>
          </div>
        </div>
      )}
    </div>
  );
};

export default SearchResults;
